Hi,

1- are we still using supplier to query slot calculation table?

{color:#4c9aff}Yes, we will use it. When the OB is created from the transport the value will be taken from loading_nr on delivery level and when the OB creation is done by Excel, it will be taken from the new column Supplier.{color}

2- will new fields be used to query slot calculation table?

{color:#4c9aff}#1 material_order_reference , #2 material_order_reference and #3delivery_location_name will not be used for the slot calculation, they are added to the booking only for giving more info to the user.{color}

{color:#4c9aff} On the other hand, #4"Supplier" and "Special Material Number" will be considered for the slot calculation{color}

3- will new fields be editable from the booking creation view as the field mastercarton?

{color:#4c9aff}Only "stackability" from the new fields will be editable during the booking creation. The rest of fields will not be editable by the carrier or the shipper.{color}
